function Homeres() {
  return (
    <div>Homeres
        <p><img src={fish1} alt="Ferry" title="fish" /></p>
        <p><img src={fish2} alt="Mbita ferry" title="Comon meal in our restaurants" /></p>
    </div>

  )
}
export default Homeres;
